sentences:
  - Soy protein isolate is produced by removing most of the fats and carbohydrates from defatted soy flour (soy flour is made by grinding soybeans into a powder).
  - 'Soybeans have a protein content of approximately 40%, whereas soy protein isolate has a protein content of 90% or higher.'
  - 'Depending on processing, soy protein isolates vary widely in concentrations of genistein and other soy isoflavones.'
  - Soy protein concentrate is a product similar to soy protein isolate which is produced by removing the water soluble carbohydrates from defatted soy flour.
  - 'Soy protein concentrate has a protein content of approximately 70% and also contains some carbohydrate, ash and oil.'
  - 'Textured soy protein is made by forming a dough from defatted soy flour plus water, extruding it through a die, and drying it.'
  - 'The extrusion process alters the structure of the soy protein, resulting in a meat like texture.'
  - 'Textured soy protein contains approximately 50% soy protein.'
  - 'It is used as a meat replacement (e.g., in veggie burgers).'
  - 'Unlike soy protein isolate and soy protein concentrate, textured soy protein is a good source of fiber and soy isoflavones.'
  - 'This web page focuses on soy protein isolate, which is a component of many processed foods, including baked foods, breakfast cereals, processed meat products, soy-based infant formulas, and some protein shakes and protein bars.'
  - 'Soybean oil, soy lecithin and soy protein isolate in processed foods are the primary forms of soy consumed by many U.S. residents.'
  - 'Separate web pages cover soybeans, soybean oil, soybean paste and tofu.'
  - We attempt to untangle the conflicting findings regarding breast cancer risk and soybean isoflavones in the genistein and daidzein web page.
  - Soy protein has been shown to improve glycemic control in diabetic postmenopausal women and to improve insulin sensitivity in female ovariectomized monkeys as well as in male monkeys.
  - Dietary intake of soy protein isolate has been found to reduce circulating insulin levels in rats.
  - Dietary soy has also been found to reduce atherosclerotic plaque development in male monkeys.
  - Several studies have found that rats with carcinogen-induced colon cancer that were fed soy protein isolate had reduced tumor incidence compared to control diets.
  - The reduction in colon tumor incidence in soy protein isolate-fed rats was found to be associated with reduced circulating insulin and leptin in one study.
  - One population study of soy consumption and thyroid cancer risk conducted in the San Francisco Bay Area found that consumption of traditional and nontraditional soy-based foods were associated with reduced risk of thyroid cancer.
  - 'However, consumption of "Western" foods with added soy flour or soy protein did not affect thyroid cancer risk.'
  - Soy protein isolate consumption has been found to have potentially beneficial impact on prostate cancer progression in some studies.
  - Estrogen is antiresorptive on the skeleton.
  - 'Hence, the lower estrogen levels associated with menopause typically result in bone loss.'
  - Diets supplemented with soy isoflavones or isoflavone-rich soy protein isolate have not been found to prevent bone resorption in postmenopausal women.
  - 'However, in a study comparing the effects of diets with casein, soy protein isolate, whey protein hydrolysate and rice protein isolate on bone in intact growing female rats and in ovariectomized rats showing signs of sex steroid deficiency-induced bone loss, soy protein isolate was found to have the greatest positive effects in both intact and ovariectomized rats.'
  - Soy protein isolate increased serum bone formation markers but suppressed bone resorption markers.
  - It is possible that consumption of soy protein isolate low in soy isoflavones may improve postmenopausal bone health but more studies are required to determine whether this is the case.
  - Evidence concerning the impact of soy protein isolate on breast cancer risk consists of animal studies and human experiments.
  - 'Population studies concerning any possible association between soy protein isolate and risk of breast cancer are not available, which is especially unfortunate since experimental studies have produced conflicting findings.'
  - Feeding soy protein isolate to female rats has been shown in several studies to decrease carcinogen-induced mammary tumor incidence.
  - 'The female offspring of the rats in one of these studies were found to have smaller mammary fat cells, lower abdominal fat mass and lower overall body weight.'
  - 'Another study found that while rats fed a soy protein isolate diet had a lower tumor incidence than rats fed a control diet, the tumors had more invasive characteristics.'
  - 'The authors ascribed the increased invasiveness to a higher ratio of progesterone receptor A to progesterone receptor B in the soy protein isolate group, accompanied by increased levels of HER-2/neu oncogene.'
  - 'However, note that soy protein isolate also contains relatively high levels of copper, which has been shown to increase angiogenesis and metastasis of breast cancer.'
  - Another study found that soy protein isolate stimulated estrogen positive breast tumor growth and increased uterus weight in ovariectomized mice.
  - Yet another study found that a high soy protein diet increased mitosis (leading to cell division) in the mammary glands of rats.
  - The change in proliferation was associated with increased estrogen receptor α (ERα) and decreased estrogen receptor β (ERβ) expression.
  - 'A one-year study of the effects of soy protein isolate consumption in women that measured changes in nipple aspirate fluid and plasma hormones, cholesterol and triglycerides found that prolonged consumption of soy protein isolate with a defined level of genistein had little effect on postmenopausal women.'
  - 'However, a stimulatory effect on the breasts of the premenopausal women was observed, characterized by increased secretion of breast fluid, the appearance of hyperplastic epithelial breast cells, and increased levels of plasma estradiol.'
  - The authors note that these findings did not support their a priori hypothesis that soy protein isolate consumption would be protective against breast cancer.
  - The U.S. Food and Drug Administration is in the process of investigating the levels of furan in soy protein isolate and other foods.
  - 'Furan, which has been found in soy protein isolate, is a toxin which is a possible human carcinogen (furan is carcinogenic in rats and mice) and has been found as a byproduct of heat treatment during processing of various foods.'
  - _Below are links to recent studies concerning this food.
  - 'For a more complete list of studies, please click on soy protein isolate._'
